INSERT INTO appgroup (id, name, description) VALUES ('10', 'Administrator', 'MNRE IT Services Unit. Users assigned this role have the ability to configure and administer the SOLA application. E.g. Add users, configure roles, update system codes, edit business rules etc.');
INSERT INTO appgroup (id, name, description) VALUES ('20', 'Search and View Property Information', 'Allows users to search and view property information. All Land Registry and QA staff have this role by default. Other staff (Technical, Accounts, etc) can be assigned this role as required.');
INSERT INTO appgroup (id, name, description) VALUES ('30', 'Search and View Only', 'Allows users to search and view application and document details as well as the Map. Printing documents, map or application details is not permitted');
INSERT INTO appgroup (id, name, description) VALUES ('40', 'Team Leader', 'Team Leaders (and ACEOs) can approve applications, re-assign applications to other staff and generate lodgement reports. This role should be combined with the appropriate staff role (e.g. Land Registry or Quality Assurance so that the team leader has access suitable for thier section.');
INSERT INTO appgroup (id, name, description) VALUES ('50', 'Accounts', 'The Accounts staff of the Accounting Division have access to set the fee payment details for lodged applications. ');
INSERT INTO appgroup (id, name, description) VALUES ('60', 'Land Registry', 'The Land Registry staff of the Land Management Division. Users assigned this role can lodge and edit land registry applications as well as generate folio certificates.');
INSERT INTO appgroup (id, name, description) VALUES ('70', 'Quality Assurance', 'The Quality Assurance Staff of the Technical Division. Users assigned this role can lodge and edit applications to process survey plans as well as view property information.  They cannot generate folio certificates.');
INSERT INTO appgroup (id, name, description) VALUES ('80', 'Technical Division', 'The Technical Division can search and view application and document details as well as  view, print and export features from the Map');
INSERT INTO appgroup (id, name, description) VALUES ('5654ca9a-595d-4a25-9809-0899dcb93673', 'Public Counter', 'Allows public counter staff to search for property and document and application information, print folio certificates and print the map and documents');
INSERT INTO appgroup (id, name, description) VALUES ('cbca8c4f-635c-4144-91af-726cba414f5f', 'View Map Only', 'Allows users to view  the Map only ');
INSERT INTO appgroup (id, name, description) VALUES ('84ef445a-6a23-49f1-907f-94497adfa0c4', 'Scan', 'Able to scan document to the database');
